True Passion - Nov 2009.  Exclusive Track.  5mins 2secs.

Funky House track. Good beginning of the night track. Speech start, with build, and the end left uncomplicated for ease of mixing out.

The vocal work on this track has been taken from the Noam Chomsky speech &quot;Why elite hates democracy.  There is a current link to this on U-Tube below.  You can check out Noam with his extensive works at his online home below.

For this track we have also uploaded the full sample pack, so you can re-mix this track or come up with something on your own.  The samples also include the .ACD file for any Acid Pro users.
